    R6::R6Class(
        "pamlsemBase",
        inherit = jmvcore::Analysis,
        public = list(
            initialize = function(options, data = NULL, datasetId = "", analysisId = "", revision = 0) {
                super$initialize(
                    package = "pamlj",
                    name = "pamlsem",
                    version = c(0, 5, 0),
                    options = options,
                    results = pamlsemResults$new(options = options),
                    data = data,
                    datasetId = datasetId,
